import "./App.css";
import React from "react";
import header from "./header";
import VCard from "./VCard";
import videos from "./exampleresponse.json";

const App = () => {
  return (
    <div className="App">

      <header/>
      <VCard data={videos} />
    </div>
  );
};

export default App;
